def replaceWords(dict, sentence):
    output = []
    curr =""
    words = sentence.split(" ")

    max_length = 0

    for i in dict:
        if len(i)>max_length:
            max_length = len(i)

    for w in words:
        curr = ""
        stop = 0
        for t in range(max_length if max_length < len(w) else len(w)):
            curr+=w[t]
            if curr in dict:
                output.append(curr)
                stop = 1
                break

        if stop == 0:
            output.append(w)


    return " ".join(output)

